import React, {Component} from 'react';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';

import Nav from './component/Nav';
import NewsById from './component/NewsById'
import NewsInCat from './component/NewsInCat';
import Home from './component/Home';

import './css/App.css';
import Listcom from './component/ListCom';

export default class App  extends Component {
    render(){
      return(
        <Router>

            <Nav></Nav>

          <Switch>
            <Route path="/" exact component={Home}></Route>
            <Route path="/category" component={NewsInCat}> </Route>
            <Route path="/post/:id" component={NewsById}></Route>
            <Route path="/coms" component={Listcom }></Route>
          </Switch>

        </Router>
      );
    }
}
